function App() {
    function great() {
        alert('Bye')
    }

    return (
        <div className="App">
            <button onClick={() => alert('Hi')}> Hello</button>
            <h1> Hello</h1>
            <h1> Hello</h1>
            <h1> Hello</h1>
            <h1> Hello</h1>
            <h1 onClick={great}> Hello</h1>
        </div>
    )
}

export default App
